"use strict";(self.webpackChunkskip_docs=self.webpackChunkskip_docs||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"sprint-15","metadata":{"permalink":"/blog/sprint-15","source":"@site/blog/2021-10-04/sprint-15.md","title":"Prosjektstatus sprint 15","description":"M\xe5lsetning for sprint 15","date":"2021-10-04T00:00:00.000Z","formattedDate":"October 4, 2021","tags":[{"label":"skip","permalink":"/blog/tags/skip"},{"label":"sprint","permalink":"/blog/tags/sprint"}],"readingTime":2.24,"hasTruncateMarker":true,"authors":[{"name":"Espen Henriksen","title":"Seniorutvikler p\xe5 SKIP","url":"http://minside/Person.aspx?accountname=STATKART\\\\HENESP","imageURL":"https://avatars.githubusercontent.com/u/5845924?v=4","key":"espen"}],"frontMatter":{"title":"Prosjektstatus sprint 15","description":"M\xe5lsetning for sprint 15","slug":"sprint-15","authors":"espen","tags":["skip","sprint"],"hide_table_of_contents":false},"nextItem":{"title":"Prosjektstatus sprint 14","permalink":"/blog/sprint-14"}},"content":"Her f\xf8lger oppsummering av sprint 14 og teamets m\xe5lsetning for sprint 15 (Okt 4,\\n2021\u2013Okt 18, 2021).\\n\\n\x3c!--truncate--\x3e\\n\\n### Oppsummering sprint 14\\n\\nI sprint 14 fikk vi gjort mye. Vi har:\\n\\n- V\xe6rt i kontakt med VmWare og f\xe5tt tips til hvordan ephemeral storage kan\\n  h\xe5ndteres slik at helm install/upgrade ikke f\xf8rer til krisetilstander (\xe5rsaken\\n  til at GitLab har g\xe5tt ned flere ganger de siste ukene)\\n- Fortsatt \xe5 forbedre dokumentasjon\\n- Ny MinIO-instans er etablert og klar for \xe5 brukes til backup\\n- Nytt testmilj\xf8 for Kubernetes/Tanzu-oppgraderinger og annen PoC-ing er\\n  etablert p\xe5 separat maskinvare som vi skal begynne \xe5 bruke for \xe5 hindre\\n  ustabilitet i prodmilj\xf8et\\n- Teamet jobber kontinuerlig med \xe5 forbedre og utvide Vault-funksjonaliteten og\\n  bruken av dette\\n- Verdivurdering, oversikt over tjenester er p\xe5 plass. Mangler fortsatt\\n  topologidiagram/arkitekturskisse\\n- Sikkerhetsanalyse: M\xe5 trimmes ned og deles opp for \xe5 bli mer h\xe5ndterbar.\\n  Analyse av GitLab nesten ferdig, mangler bare en tiltakspakke\\n- Analyse av \xe5 flytte GitLab til SaaS: Dette er noe vi \xf8nsker \xe5 f\xe5 til, men m\xe5\\n  g\xe5 gjennom konsekvensene av et stort antall bieffekter av \xe5 gj\xf8re dette\\n- Tiltak for kommunikasjon/forventningsstyring: Vi har laget\\n  kommunikasjonsstrategi og har planlagt en town hall - m\xe5 velge et tema for\\n  denne. Dato m\xe5 avklares, mulig 15. oktober\\n- Begynt \xe5 sette opp en POC av nytt verkt\xf8y for kommunikasjon med resten av\\n  Kartverket\\n- Har POCet Terraform p\xe5 noen omr\xe5der. P\xe5 sikt kommer vi til \xe5 anbefale bruk av\\n  Terraform framfor Helm til utrulling av egenutviklede applikasjoner\\n\\n### OKR-m\xe5l\\n\\nFremover skal vi bruke [OKR][okr] til \xe5 spore hvor godt vi som team oppn\xe5r v\xe5re\\nm\xe5l. V\xe5re tre m\xe5l for 4. kvartal 2021 er:\\n\\n1. Produksjonsmilj\xf8et og tooling skal ha 95% oppetid\\n2. 100% Terraform-dekning\\n3. 80% SKIP-brukere som er forn\xf8yd eller sv\xe6rt forn\xf8yd med stabilitet og\\n   brukeropplevelse\\n\\n[okr]: https://corporatefinanceinstitute.com/resources/knowledge/strategy/objectives-and-key-results-okr/\\n\\n### Plan for sprint 15\\n\\nI sprint 15 blir hovedfokuset \xe5 jobbe videre med \\"terraformifiseringen\\" av\\nverkt\xf8yene v\xe5re. P\xe5 denne m\xe5ten n\xe6rmer vi oss \\"Infrastructure as Code\\" (IaC) og\\nf\xe5r en mer fremtidssikker.\\n\\nM\xe5let for sprint 15 er ordlagt som f\xf8lger:\\n\\n> F\xe5 over minst 50% av verkt\xf8y og 1 egenutviklet applikasjon i Terraform\\n\\nI tillegg er disse delm\xe5lene med i sprinten:\\n\\n- L\xf8se lav disk/nettverks I/O i clusteret som f\xf8rer til trege bygg\\n- L\xf8se feilen med ephemeral storage som tar ned applikasjoner\\n- Ferdigstille PoC av kommunikasjonsplatform\\n- Spre kompetanse om Terraform i teamet og ut til brukerene av plattformen\\n- Fortsette med sikkerhetsanalyser\\n- Pr\xf8ve \xe5 f\xe5 n\xe6rmere samarbeid med drift\\n- Unders\xf8ke om vi skal flytte issues til Jira\\n- Vi skal fokusere mer p\xe5 brukertilfredshet fremover, og skal planlegge en\\n  sp\xf8rreunders\xf8kelse opp mot tilfredshet med plattformen. Mer info kommer"},{"id":"sprint-14","metadata":{"permalink":"/blog/sprint-14","source":"@site/blog/2021-09-23/sprint-14.md","title":"Prosjektstatus sprint 14","description":"M\xe5lsetning for sprint 14","date":"2021-09-23T00:00:00.000Z","formattedDate":"September 23, 2021","tags":[{"label":"skip","permalink":"/blog/tags/skip"},{"label":"sprint","permalink":"/blog/tags/sprint"}],"readingTime":0.555,"hasTruncateMarker":true,"authors":[{"name":"Espen Henriksen","title":"Seniorutvikler p\xe5 SKIP","url":"http://minside/Person.aspx?accountname=STATKART\\\\HENESP","imageURL":"https://avatars.githubusercontent.com/u/5845924?v=4","key":"espen"}],"frontMatter":{"title":"Prosjektstatus sprint 14","description":"M\xe5lsetning for sprint 14","slug":"sprint-14","authors":"espen","tags":["skip","sprint"],"hide_table_of_contents":false},"prevItem":{"title":"Prosjektstatus sprint 15","permalink":"/blog/sprint-15"}},"content":"Velkommen til SKIP-bloggen! Her kommer vi til \xe5 kommunisere signifikante\\nendringer i platformen samt v\xe5re fokusomr\xe5der fremover.\\n\\nHer f\xf8lger teamets m\xe5lsetning for sprint 14 (Sep 16, 2021\u2013Sep 30, 2021).\\n\\n\x3c!--truncate--\x3e\\n\\nI sprint 14 skal vi fokusere p\xe5 f\xf8lgende delm\xe5l:\\n\\n- Vi setter opp nettside for dokumentasjon og kommunikasjon mot resten av\\n  organisasjonen (den du leser dette p\xe5 n\xe5!)\\n- Vi etablerer velero som backup-system\\n- Vi ferdigstiller ELK-stack for logging av applikasjon\\n- Vi f\xe5r p\xe5 plass terraform for \xe5 bevege platformen n\xe6rmere infrastructure as\\n  code og GitOps\\n- Vi jobber videre med Vault\\n- Vi kartlegger, jobber med skystrategi og dokumenterer oppsett\\n- Vi jobber kontinuerlig med \xe5 stabilisere clusteret"}]}')}}]);